import SwiftUI

struct WeatherView: View {
    private let forecast: ForecastUseCaseProtocol = ForecastUseCase()
    @State private var weatherInfo: WeatherInfo? = testdata
    @State private var toshi: [String] = [
        "多摩市", "カリフォルニア", "八王子市", "新宿", "パリ"
    ]
    
    var body: some View {
        if let weatherInfo {
            HStack(alignment: .top) {
                VStack(alignment: .leading) {
                    HStack {
                        Text(displayTime)
                            .font(.system(size: 50))
                    }
                    .padding(.bottom, 10)
                    weatherNavigation()
                }
                VStack(alignment: .leading) {
                    VStack(alignment: .leading) {
                        Text("1時間ごとの天気")
                            .font(.system(size: 26))
                        hourlyWeatherListView(weatherInfo: weatherInfo)
                            .padding(.bottom, 16)
                        RoundedRectangle(cornerRadius: 1.0)
                            .frame(height: 2)
                        Text("日ごとの天気")
                            .font(.system(size: 26))
                        dailyWeatherListView(weatherInfo: weatherInfo)
                    }
                    currentWeatherView(weatherInfo: weatherInfo)
                }
                .padding(.top, 50)
                Rectangle()
                    .fill(.clear)
                    .frame(width: 2)
//                    RoundedRectangle(cornerRadius: 1.0)
//                        .frame(width: 2)
//                    VStack(alignment: .leading) {
//                        Text("日ごとの天気")
//                            .font(.system(size: 26))
//                        dailyWeatherListView(weatherInfo: weatherInfo)
//                    }
            }
        } else {
            ContentUnavailableView {
                Label(
                    "No weather information",
                    systemImage: "doc.questionmark.fill"
                )
            } actions: {
                Button(action: {
                    Task {
                        let result = await forecast.execute()
                        print("result \(String(describing: result))")
                        guard let data = try? result.get() else { return }
                        self.weatherInfo = data
                    }
                }, label: {
                    Label("reload", systemImage: "arrow.clockwise")
                })
            }
        }
    }
    
    private func weatherNavigation() -> some View {
        ScrollView {
            VStack {
                Button(action: {
                    Task {
                        let result = await forecast.execute()
                        print("result \(String(describing: result))")
                        guard let data = try? result.get() else { return }
                        self.weatherInfo = data
                    }
                }, label: {
                    Image(systemName: "arrow.clockwise")
                })
                ForEach(toshi, id: \.self) { item in
                    Button(action: {}, label: {
                        Text(item)
                            .font(.system(size: 40))
                            .multilineTextAlignment(.leading)
                            .frame(width: 200)
                    })
                }
            }
        }
    }
    
    private func currentWeatherView(weatherInfo: WeatherInfo) -> some View {
        HStack(alignment: .top) {
            
            VStack {
                HStack(spacing: 8) {
                    Text("今外は")
                        .font(.system(size: 40))
                        .padding(.trailing, 10)
                    Text(weatherInfo.current.weather?.emoji() ?? "✨")
                        .font(.system(size: 100))
                    Text(NSLocalizedString(weatherInfo.current.weather?.rawValue ?? "Weather.unknown", comment: ""))
                        .font(.system(size: 60))
                        .bold()
                    Text(weatherInfo.current.temperature?.description ?? "Temperature.unknown")
                        .font(.system(size: 60))
                    + Text("°C")
                        .font(.system(size: 60))
                }
            }
        }
    }
    
    @ViewBuilder
    private func hourlyWeatherListView(weatherInfo: WeatherInfo) -> some View {
        if weatherInfo.hourly.isEmpty == false {
            ScrollView(.horizontal) {
                HStack {
                    ForEach(weatherInfo.hourly, id: \.time) { item in
                        HourlyWeatherItemView(
                            time: item.time,
                            precipitationProbability: item.precipitationProbability,
                            precipitationProbabilityUnit: "%",
                            weatherEmoji: item.weather?.emoji() ?? "✨",
                            temperature: item.temperature,
                            temperatureUnit: "°C"
                        )
                    }
                }
            }
        } else {
            ContentUnavailableView {
                Label(
                    "No hourly weather",
                    systemImage: "doc.questionmark.fill"
                )
            }
        }
    }
    
    @ViewBuilder
    private func dailyWeatherListView(weatherInfo: WeatherInfo) -> some View {
        if weatherInfo.daily.isEmpty == false {
            ScrollView(.horizontal) {
                HStack {
                    ForEach(weatherInfo.daily, id: \.time) { item in
                        DailyWeatherItemView2(
                            time: item.time,
                            precipitationProbabilityMax: item.precipitationProbabilityMax,
                            precipitationProbabilityMaxUnit: "%",
                            weatherEmoji: item.weather?.emoji() ?? "✨",
                            temperatureMin: item.temperatureMin,
                            temperatureMax: item.temperatureMax,
                            temperatureUnit: "°C"
                        )
                    }
                }
            }
        } else {
            ContentUnavailableView {
                Label(
                    "No daily weather",
                    systemImage: "doc.questionmark.fill"
                )
            }
        }
    }
}

